import { UilNewspaper } from "@iconscout/react-unicons";

const sideBarState = [
  { link: "feed", title: "Feed", icon: <UilNewspaper /> },
  { link: "profile", title: "Profile", icon: <UilUserExclamation /> },
  { link: "dialogs", title: "Dialogs", icon: "" },
  { link: "friends", title: "Users" },
  { link: "news", title: "News" },
  { link: "music", title: "Music" },
  { link: "settings", title: "Settings" },
];

const sideBarReducer = (state = sideBarState) => {
  return state;
};

export default sideBarReducer;
